import React from 'react'

import "../homepage/homepage.css"
import "./about.css"

import Header from '../header/header';
import Footer from '../Footer/footer';

const About = ({setLoginUser}) => {
  return (
    <div className='about'>
    <Header />
    <div className='Main'>
    <h1>Welcome To About Page</h1>
    </div>
    <Footer/>
</div>
  )
}

export default About
